import {React, useState, useEffect} from "react";
import Axios from 'axios';



function AdminOnglet(props) { 


    useEffect(() => {
        //getListeEntreprise();
    }, []);

    console.log(props.nom)

    return (
        <div>
            {props.isShown ?
            <div className='flex flex-col  w-8/12 bg-green-400'> 
            {props.nom}
               </div> 
         :
            <div className='flex flex-col  w-8/12 bg-rose-400'>
            {props.nom}
            </div>}
        
        </div>
        );
    
}
export default AdminOnglet;
